        <div className="user">
          <img src="https://images.pexels.com/photos/3376116/pexels-photo-3376116.jpeg?auto=compress&cs=tinysrgb&w=400" alt="" />
          <div className="info">
            <span>Paula</span>
            <p>Posted 2 days ago</p>
          </div>
          <div className="edit">
            <img src="" alt="" />
          </div>
        </div>
      </div>
      <div className="menu">m</div>
    </div>
  );
};

export default Single;
